    return (
        <main>
            <h1>Home</h1>
            <span>Register as a:&emsp;</span>
            <Link to={"/professional"}>
                <Button buttonText={"Professional"} />
            </Link>
            &emsp;
            <Button buttonText={"Patient"} />
            &emsp;
            <Button buttonText={"Doctor"} />
        </main>
    );
};

export default Home;
